    false,nt"url": null,nt"notes": "Spawing season data of Mid-Atlantic finfish,
    collected by various shipsn(Delaware II, Albatross II, Atl. Twin, Xiphias, and the
    Rorqual) as partnof study "The Biology of Marine Finfish" done by Sandy Hook Laboratorynof
    National Marine Fisheries Service, Highlands, NJ. Data parametersninclude: Vessel,
    cruise number, Latitude, Longitude, date, time,ndistance fished, depth, wind and
    current measurements, gear descriptionsn(mesh size, number of floats, length of
    trawl, etc), taxonomy, sex, age,nstomach and gut contents, egg color, number, and
    condition. Data werenoriginally recorded on a 9-track tape in EBCDIC (1600 BPI)
    and have beennconverted into current NODC data sotrage format. The documentationnincludes
    a detailed description of the record format.",nt"owner_org": "e811f0b4-451f-4896-9e8f-fc6802837819",nt"extras":
